criteria.textblock:
        Inclusion Criteria:

          -  symptomatic venous outflow obstruction in one iliofemoral venous segment (i.e., one
             limb) per patient, demonstrated by:

               -  CEAP "C" ≥ 3, or

               -  VCSS pain score ≥ 2

        Key Exclusion Criteria:

          -  < 18 years of age;

          -  pregnant or planning to become pregnant in the next 12 months;

          -  planned surgical or interventional procedures of the target limb (except thrombolysis
             and/or thrombectomy in preparation for the procedure or vena cava filter placement
             prior to stent implantation in patients at high risk for pulmonary embolism) within 30
             days prior to or any time after the study procedure;

          -  planned surgical or interventional procedures for other medical conditions (i.e., not
             associated with the target limb) within 30 days prior to or after the study procedure;

          -  lesions with intended treatment lengths extending into the inferior vena cava or below
             the level of the lesser trochanter;

          -  lesion with malignant obstruction;

          -  previous stenting of the target vessel;

          -  iliofemoral venous segment unsuitable for treatment with available sizes of study
             devices.
